import Widget from "./components/Widget/Widget";
import Filter from "./components/Filter/Filter";
import CodeInfo from "./components/CodeInfo/CodeInfo";

import codeData from "./data";
import "./App.css";

function App() {
  const data = codeData;

  return (
    <div className="app-container">
      <Widget>
          <Filter data={data} />
          <CodeInfo data={data} />
      </Widget>
    </div>
  );
}

export default App;
